	return (
		<PageContainer>
			<div className="flex h-full w-full justify-center items-center">
				<p className="text-start text-2xl p-4">
					Normally I assume the chatbot would be launched from a modal or some button.
				</p>
			</div>
			<Chat />
		</PageContainer>
	);
}
